import React from 'react'
import InputText from '../inputs/input_translate';

export default function Translate_Label() {
  return (
    <div className='grid grid-cols-2'>
        <div className=''>
        <InputText/>
        </div>
        <div>
        <textarea name="Result" id="translating" cols="1" rows="2"></textarea>
        </div>
    </div>
  )
}
